import appConfig from '../app.config';
import NavigationLink from './NavigationLink';
import SocialLink from './SocialLink';

let Footer = () => {

	return (
		<footer className="has-background-grey-dark has-text-grey-lighter">
			<div className="content has-text-centered">
				<p>
					{appConfig.name} by <a href={appConfig.website} target="_blank" className="has-text-grey-lighter">{appConfig.author}</a>
				</p>
				<p>
					<NavigationLink
							linkList={[appConfig.termsOfService,appConfig.privacyPolicy]}
							classList="has-text-grey-lighter"
							type="li"
						/>
				</p>

				<p>
					{appConfig.donation.message}<br/>
					BTC: <span> {appConfig.donation.btc} </span><br/>
					ETH: <span> {appConfig.donation.eth} </span><br/>
				</p><br/>
			</div>
		</footer>
	)
}

export default Footer;
